(2, 1, 'Diagnostic Services', 'fa fa-medkit', '3.jpg', 'ARTH Diagnostics, Udaipur, Rajasthan is an establishment with more than decade old experienced team comprising of qualified and experienced Pathologists, Radiologists, Immunoassay Experts, Microbiologists and technicians for sonography, X-Ray, blood tests, urine tests, 3d color doppler ultrasound etc. in Udaipur.\n\nWe are ISO certified and only registered quality diagnostic centre with US and European Union (EU) Regd No 65-072-1645. We deliver quality services with the latest technology and utmost ethical and clinical standards. The team has gained rich experience by serving millions of patients with well-established standards. In a short time Arth Diagnostics have earned the reputation of being South Rajasthan’s best equipped diagnostic centre.', 0),
